import './App.css';
import { Button, Container, Row } from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <Container fluid className="App-header">
        <Row >
          <h1> Welcome to Chloe & Charles Wedding </h1>
        </Row>
    </Container> 
   </div>
  );
}

export default App;
